import React, { useState } from "react";
import axios from "axios";
import "./Signup.css";
import { Link } from "react-router-dom";
import Input from "../components/Input";
import { Button } from "../components/Button";
import { useForm } from "react-hook-form";
import Api from "../components/config/Api";

const Signup = () => {
  const {
    register,
    handleSubmit,
    formState: { errors },
  } = useForm;
  const onSubmit = (e) => {
    Api.post("post", {
      firstname: e.firstname,
      lastname: e.lastname,
      email: e.email,
      password: e.password,
    });
  };

  return (
    <div className="Signup">
      <h1> SIGN UP</h1>
      <Link className="Link" to="/">
        <h2 className="sign"> Login</h2>
      </Link>
      <form onSubmit={handleSubmit(onSubmit)}>
        <div className="flex">
          <div className="in">
            <Input
              place="First name"
              register={register("firstname", {
                required: true,
              })}
            />
            {errors.firstname && error.firstname.type === "required" && (
              <p>Ga Bole Kosong</p>
            )}
          </div>
          <div className="put">
            <Input
              place="Last Name"
              register={register("lastname", {
                required: true,
              })}
            />
            {errors.lastname && error.lastname.type === "required" && (
              <p>Ga Bole Kosong</p>
            )}
          </div>
        </div>

        <Input
          className="input"
          place="Email"
          register={register("email", {
            required: true,
          })}
        />
        {errors.email && error.email.type === "required" && (
          <p>Ga Bole Kosong</p>
        )}

        <Input
          className="input"
          type="password"
          place="Password"
          register={register("password", {
            required: true,
          })}
        />
        {errors.password && error.password.type === "required" && (
          <p>Ga Bole Kosong</p>
        )}

        <Input
          type="password"
          place="Confirm Password"
          register={register("confirmPassword", {
            required: true,
          })}
        />
        {errors.confirmPassword &&
          error.ConfirmPassword.type === "required" && <p>Ga Bole Kosong</p>}

        <Button />
      </form>
    </div>
  );
};

export default Signup;
